import React from 'react';

export default function Footer() {
  return (
    <div>
      <footer>
        <div className="flex w-full space-x-2 bg-slate-600">
          <div className="flex-1">Logo</div>
          <div>Logo</div>
        </div>
      </footer>
    </div>
  );
}
